import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Evento extends Component {
  render() {
    return (
      <div className="App">
      </div>
    );
  }
}

Evento.propTypes = {
    info: PropTypes.object.isRequired
}

export default Evento;
